    SetName(e.target.value);
  }
  const userAgeHandler=(e)=>{
  SetAge(e.target.value);
  }

     const AddUserHandler=(e)=>{
        e.preventDefault();
        const obj={
            name:userName,
            age:userAge
        }
        props.getdata(obj)


}

 return  <div>
<form className="form-control" onSubmit={AddUserHandler}>
    <label >UserName</label>
    <br></br>
